<li>安全性是防止非法用户进入数据库，以及合法用户进入数据库后做了（未授权的）非法操作。</li>
<li>完整性是防止非法数据进入数据库，即使是合法用户及合法操作产生的。
<ul>
<li>目的：防止非法、不合语义的数据被输入和输出，即所谓的“垃圾进垃圾出”（Garbage In Garbage Out）</li>
